Lets decide where we want to put our protobuf file. Bazel doesn't care where we put it, so I'm going to arbitarly pick //src/proto/summation as the path for it. Let's put to protobuf file in $HOME/repo/src/proto/summation/summation.proto with these contents syntax = "proto3"; package src_proto_summation; service Summation { rpc ComputeSumF64(ComputeSumF64Request) returns (ComputeSumF64Response);
} message ComputeSumF64Request { repeated double value = 1;
} message ComputeSumF64Response { double sum = 1;
} Our package name above is unconventional, we are using underscores instead of dots. This is to match the crate naming convention we adopted for rust libraries.

