To get a rust protobuf/gRPC library we need to run two steps. The first is running the tonic_build generator, which we can think of as having a build.rs or cargo build script that we run first. We'll use rules_rust [cargo_build_script] to do this. First lets make the $HOME/repo/src/proto/summation/build.rs: fn main() -> Result<(), Box<dyn std::error::Error>> { tonic_build::compile_protos("./summation.proto")?; Ok(())
} Next lets update $HOME/repo/src/proto/summation/BUILD to use it: load("@rules_proto//proto:defs.bzl", "proto_library")
load("@rules_rust//cargo:cargo_build_script.bzl", "cargo_build_script") proto_library( name = "proto", srcs = [ "summation.proto", ], visibility = ["//visibility:public"],
) cargo_build_script( name = "generate_rust_proto", srcs = [ "build.rs", ], deps = [ "//third_party/rust:tonic_build", ], build_script_env = { "RUSTFMT": "$(execpath @rules_rust//:rustfmt)", "PROTOC": "$(execpath @com_google_protobuf//:protoc)" }, data = [ "summation.proto", "@rules_rust//:rustfmt", "@com_google_protobuf//:protoc", ],
) We've added a load line for cargo_build_script and then invoked that rule to run the generator. There's a lot going on here. One thing to note is Bazel uses different attributes to convey different types of dependencies . We've seen srcs and deps already, data is kind of a catch-all used when things don't fit in srcs or deps. How these attributes are used varied based on the rule, so it's useful to check the docs of the rule you're using. In this case we're telling bazel that if the protofil, rustfmt, or protoc change we need to rerun the build script using the data attribute, and we're also telling it to expose those in the sandbox it runs the compile in. When we run the build script, we also need to set the environment variables RUSTFMT and PROTOC so that tonic_build knows where to find those, which is what the build_script_env attribute does. The @rules_rust is us pointing to the external rules_rust bazel workspace we're depending on in our WORKSPACE file. The srcs attribute points to our build.rs file (which we could have named something else like generate_rust_proto.rs if we wanted.

