Now lets build the rust container image by editing $HOME/repo/src/services/summation/BUILD. We're going to add a new load rule and also a rust_image target, resulting in: load("@rules_rust//rust:defs.bzl", "rust_binary")
load("@io_bazel_rules_docker//rust:image.bzl", "rust_image") rust_binary( name = "server", srcs = [ "main.rs", "my_summation.rs", ], deps = [ "//src/proto/summation:src_proto_summation", "//src/summation:src_summation", "//third_party/rust:tokio", "//third_party/rust:tonic", ],
) rust_image( name = "server_image", binary = ":server",
) That's pretty simple, we just have to tell the rust_image rule the binary target we want it to put in a container. Let's try building it, this time using -c opt so we get the equivilant of a --release build: bazel build -c opt //... If you have docker installed, you can run the image using: bazel run -c opt //src/services/summation:server_image And then from another window you should be able to test with grpcurl: $ grpcurl -proto $HOME/repo/src/proto/summation/summation.proto -plaintext -d '{"value": 5.0, "value": 2.0}' localhost:50051 src_proto_summation.Summation/ComputeSumF64
{ "sum": 7
} To bring down the container you can run docker ps to find its id and use docker kill [container id] to bring it down. If you wanted to pass arguments to docker you can use -- in the bazel run command and then include them. For example: bazel run -c opt //src/services/summation:server_image -- -d -p 50051:50051
